import React from 'react'
import CategoryButton from './CategoryButton'


export default class Categories extends React.Component {


    render(){
        const {categories, onClickFunction} = props
        return (<div className="categories">
    <h5>Category Filters {this.props.categories.map(category => 
    <CategoryButton  key={category} category={category} onClickFunction={this.props.onClickFunction}/>)}</h5>
        </div>)
    }
}
